function submit_check(c){var a=document.getElementById("name").value;var b=document.getElementById("key").value;var d=document.getElementById("value").value;if(c=="oninput"){document.getElementById("submit").disabled=!((b=="0"||b=="1"||b=="2.0"||b=="2.1"||b=="2.2")&&a!=""&&d!="")}else{if(c=="onfocus"){document.getElementById("key_unsigned").classList.add("hidden")}else{if(b!="0"&&b!="1"&&b!="2.0"&&b!="2.1"&&b!="2.2"){document.getElementById("key_unsigned").classList.remove("hidden");document.getElementById("submit").disabled=true}}}};